export default {
  name: "ContactFormComponent",
  data() {
    return {
      formData: {
        name: "",
        email: "",
        message: "",
      },
      formErrors: {
        name: "",
        email: "",
        message: "",
      },
      formSubmitted: false,
    };
  },
  methods: {
    submitForm() {
      // Lógica para enviar o formulário
      this.formSubmitted = true;
      // Lógica para limpar os campos do formulário após o envio
      this.formData.name = "";
      this.formData.email = "";
      this.formData.message = "";
    },
  },
};
